import { Form, Button, Input, Upload } from "antd";
import { UploadOutlined } from "@ant-design/icons";
const FormItem = Form.Item;
import React, { useState } from "react";
import router from "next/router";
import Header from "./components/component.header";

const props = {
  action: "https://www.mocky.io/v2/5cc8019d300000980a055e76",
  onChange({ file, fileList }) {
    if (file.status !== "uploading") {
      console.log(file, fileList);
    }
  },
  defaultFileList: [
    {
      uid: "1",
      name: "xxx.png",
      status: "done",
      response: "Server Error 500", // custom error message to show
      url: "http://www.baidu.com/xxx.png",
    },
    {
      uid: "2",
      name: "yyy.png",
      status: "done",
      url: "http://www.baidu.com/yyy.png",
    },
    {
      uid: "3",
      name: "zzz.png",
      status: "error",
      response: "Server Error 500", // custom error message to show
      url: "http://www.baidu.com/zzz.png",
    },
  ],
};

function InsertProduct() {
    const [nameProduct , setNameProduct] = useState('')
    const [descriptionProduct , setDescriptionProduct] = useState('')
    const [priceProduct , setPriceProduct] = useState('')
    const [blandProduct , setBlandProduct] = useState('')

  return (
    <FormItem style={{ margin: "0px" }}>
      <div className="br">
        <div className="br-header">
          <Header />
        </div>
        <h2 style={{ color: "black" }}>ชื่อสินค้า</h2>
        <Input />
        <h2 style={{ color: "black" }}>รายละเอียดสินค้า</h2>
        <Input />
        <h2 style={{ color: "black" }}>ราคาสินค้า</h2>
        <Input />
        <h2 style={{ color: "black" }}>แบรน์สินค้า</h2>
        <Input />
        <Upload {...props}>
          <Button>
            <UploadOutlined /> Upload
          </Button>
        </Upload>
        <Button>เพิ่มสินค้า</Button>
      </div>
    </FormItem>
  );
}

export default InsertProduct;
